import { useState, useEffect } from "react";

function FetchData(){
  const [data, setData] = useState([])

  useEffect(() => {
    fetch("https://localhost:8080/flashcards")
      .then(res => res.json())
      .then(data => setData(data))
      .catch(err => console.log(err))
  }, [])

  return (
    <div>
      <ul>
        {data.map((list, index) => (
          <li key={index}>{list.id} {list.frontside}</li>
        ))}
      </ul>
    </div>
  );
}

export default FetchData
